/* callbacks */
const tooltip_title_callback = (tooltipItems) => {

    let time_in_seconds = tooltipItems[0].dataIndex * 2;
    let time_in_mins = Math.floor(time_in_seconds / 60);
    let seconds_left = time_in_seconds % 60;

    return time_in_mins + "m " + seconds_left + "s";
}

